import React,{Component} from 'react';
import './Home.scss'
class Home extends Component{
    render(){
        return(
            <div id="homePage">
                <div className="title">
                    <span className="name">محمد <span>خزائی</span></span>
                    <span className="job"><span>Front-End</span>  Developer</span>
                </div>
                <div className="socoal-icons">djkfds</div>
            </div>
        )
    }
}
export default Home
